import React, { Component } from "react";
import DetailCard from "../Presentation/DetailCard";

export default class GigsList2 extends Component {
  state = { venues: [] };
  loggedInUser = parseInt(sessionStorage.getItem("credentials"));omponentDidMount() {
    fetch("http://localhost:8088/venues")
      .then(e => e.json())
      .then(venues => this.setState({ venues: venues }));
  }

  render() {
    return (
      <React.Fragment>
        <section className="section-content">
          <button
            type="button"
            className="btn"
            onClick={() => {
              this.props.history.push("/venues/new");
            }}
          >
            Add Venue
          </button>
        </section>

        {this.state.venues.map(venue => (
          <DetailCard
            id={venue.id}
            name={venue.name}
            resource="venues"
            city={venue.city}
            state={venue.state}
            capacity={venue.capacity}
          />
        ))}
      </React.Fragment>
    );
  }
}
